import React from 'react';

function About() {
  return (
    <div>
      <h1>About the National Park App</h1>
      <p>
        Welcome to the National Park Explorer App. Here, you can view
        information and images of all that the national park service has to
        offer. To get started, simply click on the Activities menu where you can
        select an activity you are interested in. From there, you can browse a
        list of national park service locations that offers the activity you
        select! Afterwards, you can check out each locations's webpage where you
        can learn more about the park and view scenic images of the park.
      </p>
    </div>
  );
}

export default About;
